import React, { Component } from 'react';
import Todo from "./components/Todo"

class App extends Component{
  render(){
    return(
      <div className = "App" style = {{justifyContent:'center', alignItems:'center'}}>
        <Todo />
      </div>
    );
  }
}

export default App;
